import {SHOP_DATA} from '../../pages/shoppage/shop.data'



const INITITAL_STATE = SHOP_DATA;



const shopReducer = (state=INITITAL_STATE, action) => {
    switch(action.type){
        default:
            return state
    }
}

export default shopReducer;
